import React from 'react';
import { connect } from 'react-redux';
import { ClientsFeetchData } from '../Redux/Actions/actions';

class ClientsList extends React.PureComponent {
  render() {
    return (
      <>
        <table>
          <tr>
            <th>Name</th>
            <th>Surname</th>
            <th>Phone</th>
            <th>Email</th>
          </tr>
          <tr>
            <td></td>
          </tr>
        </table>

        <button onClick={this.props.getClients}>ClientsList</button>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {
    clientsList: state.ClientsList,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getClients: () => dispatch(ClientsFeetchData()),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(ClientsList);
